import React from 'react';
import { Link, useHistory } from 'react-router-dom'; // Using useHistory for redirection
import './Navbar.css';

const Navbar = () => {
  const history = useHistory();

  // Logout function
  const handleLogout = () => {
    // Clear session/localStorage or tokens if used for authentication
    localStorage.removeItem('user'); // Assuming 'user' is stored in localStorage

    // Redirect to homepage or login page after logout
    history.push('/'); // This will redirect to the homepage
  };

  return (
    <nav className="navbar">
      <h1>EduCore</h1>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/courses">Courses</Link></li>
        <li><Link to="/exam-schedule">Exam Schedule</Link></li>
        <li><Link to="/faculty">Faculty</Link></li>
        <li><Link to="/timetable">Timetable</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
      {/* Adding the logout button here */}
      <button className="logout-button" onClick={handleLogout}>Logout</button>
    </nav>
  );
};

export default Navbar;
